📯   Hey everyone, big news 

@philipkocanda and @iMartzen have helped get this [Merge Request](https://github.com/Hacker0x01/react-datepicker/pull/2768) from 2021 over the finish line, so most of the credit goes to [@TiesWestendorp](https://github.com/TiesWestendorp) 👏  

![109517347-70796e00-7aa9-11eb-8f8c-08ddaf6688da](https://github.com/Hacker0x01/react-datepicker/assets/23737561/62df591b-dde6-4acc-b5a3-fccae7f65eb6)

⚙️ **Implementation**
```
() => {
  const [startDate, setStartDate] = useState(new Date("2021/02/22"));
  return (
    <DatePicker
      selected={startDate}
      onChange={(date) => setStartDate(date)}
      dateFormat="I/R"
      locale="en-GB"
      showWeekNumbers
      showWeekPicker
    />
  );
};
```

